import React from 'react';

const Project_box= props =>(
    <div className="col-lg-6"><h1 className="text-center">{props.project.title}</h1>
<h2 className="text-center">{props.project.description}</h2>
<h2>{props.project.teamSize}</h2>
</div>

);

class Project extends React.Component{
    constructor(props){
    super(props)
        this.state={

              projects:[{title:'name',description:'name',teamSize:0},
              {title:'name',description:'name',teamSize:0}]
        }
    }

    project_list(){
        return this.state.projects.map(current =>{
            return <Project_box project={current}  />;
        })
    }
    render(){
        return(
            <div className="container-fluid education_bg">
                <hr />
                <h1 className="text-center"> Project</h1>
                <div className="row">
                {this.project_list() }
                </div>
            </div>
        );
    }
}

export default Project;
